-- select * from #input_gift 

drop table if exists #hash_cnt


; with cte as (
select
rn = row_number() over (order by s_id)
, gn =  ( row_number() over (order by s_id) - 1 )   / 4
, hash_cnt = len(s) - len(replace(s, '#', ''))
, *
from #input_gift
where len(s) > 0 
)
select  
gn
, cnt = sum(hash_cnt)
into #hash_cnt 
 from cte
group by gn


drop table if exists #stg

; with regions as (
select 
cleaned = TRANSLATE(s, 'x:', '..')
, * 
from #input_region
) 
, gift_cte as 
(
    select 
    cleaned
    , s_id
    , part = -1 
    , curr = cast('' as varchar(max))
    , rem = trim( PARSENAME(cleaned, 1)) + ' '
    from regions
    union all 
    select 
    cleaned
    , s_id
    , part + 1
    , cast( left(rem, CHARINDEX(' ', rem)-1) as varchar(max)) 
    , SUBSTRING(rem, CHARINDEX(' ', rem)+1, len(rem))    
    from gift_cte 
    where len(rem) > 1
)
select 
cleaned
, s_id
, gift_id = cast(part as int)
, gift_cnt = cast(curr as int)
into #stg
from gift_cte
where part != -1

-- 541

; with cte as (
select 
s_id
, gift_max_allowd = cast(PARSENAME(cleaned,3) as int) * cast(PARSENAME(cleaned, 2) as int) 
, total_gift_space = sum(h.cnt * s.gift_cnt)
from #stg s inner join #hash_cnt h 
on s.gift_id = h.gn
group by s_id, cast(PARSENAME(cleaned,3) as int) * cast(PARSENAME(cleaned, 2) as int)  
)
select ans = count(*) from cte 
where gift_max_allowd >= total_gift_space


